import numpy as np
import tensorflow as tf
from tensorflow import nn


def layernorm_my(inputs, offset, scale, epsilon):
    mean, variance = nn.moments(inputs, 0)
    outputs = nn.batch_normalization(
        inputs,
        mean,
        variance,
        offset=offset,
        scale=scale,
        variance_epsilon=epsilon)
    return outputs


